--playlistdata table

CREATE TABLE PlaylistData(
   playlist_id           VARCHAR(22) NOT NULL,
   playlist_name         VARCHAR(96),
   playlist_total_tracks INTEGER,
   owner_id              VARCHAR(28),
   owner_name            VARCHAR(23),
   total_followers       INTEGER,
CONSTRAINT pk_PlaylistData_playlist_id PRIMARY KEY (playlist_id))

-- track table create

CREATE TABLE TracksData(
   track_id      VARCHAR(22) NOT NULL,
   name          VARCHAR(92),
   popularity    INTEGER,
   duration_ms   INTEGER,
   artist_id     VARCHAR(286),
   artist_name   VARCHAR(144),
   num_artists   INTEGER,
   playlist_id   VARCHAR(22),
   playlist_name VARCHAR(46),
CONSTRAINT pk_TracksData_track_id PRIMARY KEY(track_id),
              CONSTRAINT fk_TracksData_track_id FOREIGN KEY (track_id)
              REFERENCES PlaylistData (playlist_id)
              ON DELETE NO ACTION ON UPDATE NO ACTION))

-- Artistdata table
CREATE TABLE ArtistData(
   track_id      VARCHAR(22),
   track_name    VARCHAR(92),
   artist_id     VARCHAR(22) NOT NULL,
   artist_name   VARCHAR(28),
   album_id      VARCHAR(22),
   duration      INTEGER,
   release_date  VARCHAR(8),
   popularity    INTEGER,
   danceability  NUMERIC(5,3),
   energy        NUMERIC(5,3),
   liveness      NUMERIC(6,4),
   playlist_id   VARCHAR(22),
   playlist_name VARCHAR(46))
CONSTRAINT pk_ArtistData_artist_id PRIMARY KEY(track_id),
CONSTRAINT fk_ArtistData_artist_id FOREIGN KEY (playlist_id)
          REFERENCES PlaylistData (playlist_id)
          ON DELETE NO ACTION ON UPDATE NO ACTION
CONSTRAINT fk_ArtistData_artist_id FOREIGN KEY (track_id)
          REFERENCES TracksData(track_id)

